import React from 'react';
import Django from '../assets/images/backend/img_django.png';
import Node from '../assets/images/backend/img_node.png';
import Express from '../assets/images/backend/img_express.png';
import Spring from '../assets/images/backend/img_spring.png';
import Laravel from '../assets/images/backend/img_laravel.png';
import Reactimg from '../assets/images/frontend/img_react.png';
import Angular from '../assets/images/frontend/img_angular.png';
import Vue from '../assets/images/frontend/img_vue_t.png';



export const BackendList = [
    {   
        id:"1",
        name:"Django",
        source:Django,
        url:"https://www.djangoproject.com/",
    },
    {   
        id:"2",
        name:"Node JS",
        source:Node,
        url:"https://nodejs.org/en/",
    },
    {   
        id:"3",
        name:"Express JS",
        source:Express,
        url:"https://expressjs.com/",
    },
    {   
        id:"4",
        name:"Spring Boot",
        source:Spring,
        url:"https://spring.io/projects/spring-boot",
    },
    {   
        id:"5",
        name:"Laravel",
        source:Laravel,
        url:"https://laravel.com/",
    },
]
